import React, { useState } from 'react'
import NoteList from './NoteList'
import Inputs from './Inputs'







const App = () =>{
    const [add, setArray] = useState([])
    const addNote = (value) =>{
       setArray((prevData)=>{
           return [...prevData, value]
       })
       console.log(value)
    }
    
    return(
        <>
        <div className="wrapper">
            <div className="container">
                <Inputs
                createNote = {addNote}
                />
                <NoteList/>
            </div>
        </div>
        </>
    )
}


export default App;
